import React from 'react';
import styled from 'styled-components';
import CrossLogo from '../static/red-cross.png';

// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';
// import Container from 'react-bootstrap/Container';


const CardWrapper = styled('div')`

    border: 1px solid #c7c2c2;
    background: #fff;
    margin: 20px;
    min-height: 100px;
    border-radius: 10px;
    padding: 10px 10px;
    width: 50%;

`

const IconWrapper = styled('img')`
	display: flex;
	flex-direction: column;
	align-items: center;
    justify-content: center;
	height: 15px;
	width: 20px;
`


const Text2Wrap = styled('div')`
	font-size:15px;
	font-weight:bold;
	color:#000066;
	display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;

`
const TextWrap = styled('div')`
	font-size:15px;
	font-weight:bold;
	color:#000066;

`


const ParaWrap = styled('div')`
	font-size:12px;
	color:grey;
`
const ButtonWrap = styled('div')`
	border: 1px solid #007bff;
    color: white;
    font-size: 10px;
    background:green;
    border-radius:5px;
    font-weight:bold;
    height:25px;
    display: flex;
    flex-direction: column;
    text-align: center;
    justify-content: center;
    padding: 0 8px;

`
const DoseWrap = styled('div')`
	margin-left:100px;
`
const Row = styled('div')`
	display:  flex;
	flex-direction: row;
	border : 1px solid white;
    margin-top:5px;
    justify-content: space-between;
    padding: 7px;
`
const Col = styled('div')`
	display:  flex;
	flex-direction: column;
	border : 1px solid white;
	width:30%;
`
const RowWrapper = styled('div')`
	display:  flex;
	flex-direction: row;
	border : 1px solid white;
	justify-content: flex-end;
	font-weight:bold;
`
const ColWrapper = styled('div')`
	display:  flex;
	flex-direction: row;
	border : 1px solid white;
`
const ButWrap = styled('div')`
	border : 1px solid white;
	background:blue;
	color:white;
	font-size:15px;
	font-weight:bold;
	border-radius:5px;
	text-align:center;
	display: flex;
    flex-direction: column;
    justify-content: center;
    padding: 10px;

    @media (max-width: 768px) {
    	width: 90px;
    }
`

const Card = () => (
	<CardWrapper>
        <TextWrap>HSC GOVINDPUR</TextWrap>
        <Row>
			<Col>
			   <ParaWrap>HSC GOBINDPUR NEAR BOKARO THERMAL HOSPITAL,BOKARO THERMAL,JHARKHAND,829107</ParaWrap> 
			</Col>
			<Col>
			   <RowWrapper>Covishield</RowWrapper>
			   <RowWrapper>
			        <ButtonWrap>FREE</ButtonWrap>
			   </RowWrapper>
			</Col>
        </Row>
        <Row>
           <ColWrapper>
                <ButWrap>18 & ABOVE</ButWrap>
           </ColWrapper>
           <ColWrapper>
                <Text2Wrap>DOSE 1</Text2Wrap>
                <IconWrapper src={CrossLogo}/>
           </ColWrapper>
           <ColWrapper>
                <Text2Wrap>DOSE 2</Text2Wrap>
           </ColWrapper>

        </Row>


	</CardWrapper>
)

export default Card;
